import React from "react";
import { Container } from "react-bootstrap";

const Loginpage = () => {
  return (
    <div style={{ backgroundColor: "#AEB4D4", height: "100vh" }}>
      <Container>
        <h5 style={{al:""}}>Your Logo</h5>
        <div>
          <div></div>
          <div></div>
        </div>
      </Container>
    </div>
  );
};

export default Loginpage;
